      | 366751 -> { ItemTypeData.id= 366751; name= "'Poltergeist' Ishukone Cloak Field"; published= false; description= "The cloak field absorbs electromagnetic emissions and manipulates light to render the dropsuit practically invisible. When active, the field alters the magnetic permeability of the suit’s surface area to generate a negative refractive index.     While cloaked, the suit’s susceptibility to magnetometric waves is moderately reduced, allowing it to evade all but the most sensitive scanning systems. However, cascading distortion introduced by weapon or equipment activation will desychronize the suit’s sensors and short-circuit the cloak."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
